import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { ThemeProvider } from '@mui/material/styles'; // Importa ThemeProvider
import Login from './components/autenticacion/login';
import MainPage from './components/layout/mainpage';
import UsuariosPage from './components/pages/usuariosPage';

// Importa tu tema personalizado si lo tienes
// import theme from './tu-ruta-al-tema/theme'; 

function App() {
  return (
    <ThemeProvider>
      {/* Puedes pasar tu tema personalizado al ThemeProvider como prop 'theme' */}
      {/* <ThemeProvider theme={theme}> */}
      <Router>
        <Switch>
          {/* Página de inicio de sesión */}
          <Route path="/login" exact>
            <Login />
          </Route>

          {/* Páginas principales después de iniciar sesión */}
          <Route path="/main" exact>
            <MainPage />
          </Route>

          <Route path="/usuarios" exact>
            <UsuariosPage />
          </Route>
        </Switch>
      </Router>
      {/* </ThemeProvider> */}
    </ThemeProvider>
  );
}

export default App;
